  false,\n\t\"url\": null,\n\t\"notes\": \"Surface weather observation forms for 26
  stations in Uruguay. Period of record 1896-2005, with two to eight observations
  per day. Files created through a collaboration between NCDC's Climate Database Modernization
  Program (CDMP) and the Uruguayan National Meteorological Service (NMS). Paper records
  remained custody of the NMS, whose staff captured .jpg images of the records using
  a Canon Powershot A80 digital camera. The images were sent via CD-ROM to CDMP contractors,
  who loaded them to this library and entered the indexing metadata. Data was keyed
  into NCDC's surface hourly observations dataset.\",\n\t\"license_title\": null,\n\t\"extras\":
